// - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - STYLES - - - - - - - - - - - - - - - - - - - - - - -

const textStyle = {
    size: 28,
    font: "Arial",
    color: '000000'
}

const paragraphStyle = {
    spacing: {
        before: 125,
        after: 125,
    },
}

const headerTextStyle = {
    ...textStyle,
    size: 36,
}

const headerParagraphStyle = {

    ...paragraphStyle,
    alignment: docx.AlignmentType.CENTER,
}

const cellTextStyle = {
    ...textStyle,
    size: 24,
}

const cellHeaderTextStyle = {
    ...cellTextStyle,
    color: 'ffffff',
}

const cellStyle = {
    borders: {
        top: {color: "d9d9d9", size: 5, style: docx.BorderStyle.SINGLE},
        bottom: {color: "d9d9d9", size: 5, style: docx.BorderStyle.SINGLE},
        left: {color: "d9d9d9", size: 5, style: docx.BorderStyle.SINGLE},
        right: {color: "d9d9d9", size: 5, style: docx.BorderStyle.SINGLE},
    }
}

const cellHeaderStyle = {
    ...cellStyle,
    shading: {
        color: '3C78D8',
        type: docx.ShadingType.SOLID,
    }
}

const cellPreHeaderStyle = {
    ...cellStyle,
    shading: {
        color: 'c9daf8',
        type: docx.ShadingType.SOLID,
    },
}

// - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - FUNCTIONS - - - - - - - - - - - - - - - - - - - - - - -
function createHeader(text, level = 2) {

    let textStyles = textStyle;
    let paragraphStyles = paragraphStyle;

    if (level === 1) {

        textStyles = headerTextStyle;
        paragraphStyles = headerParagraphStyle;
    }
    return new docx.Paragraph({
        children: [
            new docx.TextRun({
                text: text,
                ...textStyles
            })
        ],
        heading: docx.HeadingLevel['HEADING_' + level],
        ...paragraphStyles
    })
}

function createLogo(image) {

    return new docx.Paragraph({
        children: [
            new docx.ImageRun({
                data: image,
                transformation: {
                    width: 271,
                    height: 87,
                },
            }),
        ],
        alignment: docx.AlignmentType.CENTER,
        spacing: {
            after: 300,
        },
    },)
}

function createParagraph(text) {

    return new docx.Paragraph({
        children: [new docx.TextRun({
            text: text,
            ...textStyle
        })],
        ...paragraphStyle
    })
}

function createCell(values, type = 'common') {

    let cellStyles = cellStyle;
    let cellTextStyles = cellTextStyle;

    if (type === 'header') {
        cellStyles = cellHeaderStyle;
        cellTextStyles = cellHeaderTextStyle;
    } else if (type === 'preHeader') {
        cellStyles = cellPreHeaderStyle;
    }

    const text = (Array.isArray(values)) ? values.join(', ') : values;

    return new docx.TableCell({
        children: [
            new docx.Paragraph({
                children: [new docx.TextRun({
                    text: text,
                    ...cellTextStyles
                })],
                ...paragraphStyle,
            })
        ],
        ...cellStyles
    })
}

function createHeaderRow(values) {

    console.log('createHeaderRow', values)

    const cells = [];

    for (let value of values) {
        cells.push(createCell(value, 'header'));
    }

    return new docx.TableRow({
        children: cells,
    })
}

function createCommonRow(values) {

    const cells = [];

    for (let value of values) {
        cells.push(createCell(value));
    }

    return new docx.TableRow({
        children: cells,
    })
}

function createBasicTable(data) {

    const rows = [];

    for (let key in data) {

        rows.push(
            new docx.TableRow({
                children: [
                    createCell(key, 'header'),
                    createCell(data[key]),
                ],
            })
        )

    }

    return new docx.Table({
        columnWidths: [50, 50],
        width: {
            size: 100,
            type: docx.WidthType.PERCENTAGE,
        },
        rows: rows,
    })
}

function createEducationTable(data) {

    const rows = [];

    rows.push(createHeaderRow(Object.keys(data)));
    rows.push(createCommonRow(Object.values(data)));

    return new docx.Table({
        columnWidths: [33.33, 33.34, 33.33],
        width: {
            size: 100,
            type: docx.WidthType.PERCENTAGE,
        },
        rows: rows,
    })
}

function createLanguagesTable(data) {

    const headers = ['Language', 'Level']

    const rows = [];

    rows.push(createHeaderRow(headers));

    for (let key in data) {
        rows.push(createCommonRow([key, data[key]]));
    }

    return new docx.Table({
        columnWidths: [50, 50],
        width: {
            size: 100,
            type: docx.WidthType.PERCENTAGE,
        },
        rows: rows,
    })
}

function createSkillsTable(data) {

    const headers = ['Skill', 'Level']

    const rows = [];

    rows.push(createHeaderRow(headers));

    for (let key in data) {
        rows.push(createCommonRow([key, data[key]]));
    }

    return new docx.Table({
        columnWidths: [50, 50],
        width: {
            size: 100,
            type: docx.WidthType.PERCENTAGE,
        },
        rows: rows,
    })
}

function createProjectTable({name, date, ...args}) {

    const rows = [];

    rows.push(new docx.TableRow({
        children: [createCell(name, 'header'), createCell(date, 'header')],
    }));

    for (const key in args) {

        rows.push(new docx.TableRow({
            children: [createCell(key, 'preHeader'), createCell(args[key])],
        }));
    }

    return new docx.Table({
        columnWidths: [30, 70],
        width: {
            size: 100,
            type: docx.WidthType.PERCENTAGE,
        },
        rows: rows,
    })
}

function createProjects(data) {

    const tables = [];

    for (const project of data) {
        tables.push(createParagraph(('')));
        tables.push(createProjectTable(project));
        tables.push(createParagraph(('')));
    }

    return tables;
}

