function createDoc({basicData, educationData, languagesData, skillsData, projectsData}) {

    const doc = new docx.Document({

        sections: [
            {
                headers: {
                    default: new docx.Header({
                        children: [
                            createLogo(image)
                        ]
                    })
                },

                children: [
                    createHeader('SENLA, Software Engineering Laboratory', 1),
                    createHeader('Employee Profile', 1),

                    createParagraph(' '),

                    createHeader('Basic info'),
                    createBasicTable(basicData),

                    createParagraph(' '),

                    createHeader('Education'),
                    createEducationTable(educationData),

                    createParagraph(' '),

                    createHeader('Languages'),
                    createLanguagesTable(languagesData),

                    createParagraph(' '),

                    createHeader('Skills'),
                    createSkillsTable(skillsData),
                ]
            },
            {
                children: [
                    createHeader('Past projects experience:'),
                    ...createProjects(projectsData),
                ]
            }
        ]
    });

    docx.Packer.toBlob(doc).then((blob) => {
        console.log(blob);
        saveAs(blob, "example.docx");
        console.log("Document created successfully");
    });
}

createDoc(data);